import React, { Component } from "react";
import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, NavbarDefault, NavDropdown, Glyphicon } from "react-bootstrap";
import Home from "./Home";
import Stuff from "./Stuff";
import Contact from "./Contact";
import "./Main.scss";

class Main extends Component {
  render() {
    return (
      <HashRouter>
        <div className="container">

          <div className="navigation text-center">
            <h1>Frederick &amp; Grace</h1>
            <nav className="navbar navbar-default">
              <ul className="nav navbar-nav">
                <li><NavLink exact to="/">Welcome</NavLink></li>
                <li><NavLink to="/stuff">Our Story</NavLink></li>
                <li><NavLink to="/contact">RSVP</NavLink></li>
                <li><NavLink to="/contact">Moments</NavLink></li>
                <li><NavLink to="/contact">Registry</NavLink></li>
              </ul>
            </nav>

          </div>
          <div className="content">
            <Route exact path="/" component={Home}/>
            <Route path="/stuff" component={Stuff}/>
            <Route path="/contact" component={Contact}/>
          </div>
        </div>
      </HashRouter>
    );
  }
}

export default Main;
